import React, { useEffect } from "react";
import { useAuthContext } from "../context/AuthContext";

export default function UserProfileMain() {
  const { user } = useAuthContext();

  useEffect(() => {
    console.log(user);
  }, []);

  return (
    <>
      <div className="solo-movie">
        <div className="saludo">
          <h1>{`Bienvenido ${user.name} ${user.lastname} (miembro desde)`}</h1>
        </div>
        <div className="boton-container">Usuarios Amigos favoritos</div>
      </div>
    </>
  );
}
